      color: 'red',
      fontSize: 30
    }

     return (
        <div>
          <p style={ testStyle }>Test static data</p>
        </div>
     );
  }
}


class Header extends React.Component {
  render() {
    return (
      <div>
          <p>HEADER</p>
      </div>
    );
  }
}

class Footer extends React.Component {
  render() {
    return (
      <div>
        <p>FOOTER</p>
      </div>
    );
  }
}



export default App;
